import React, {useState} from 'react'
import Todo from './Todo'
import "./Styling/List.css"

function List( { todos , setTodos, todo, filteredTodos} ) {

// console.log(todos)
    return (
<div className='list-container'>
<ul className='todo-list'>
{filteredTodos.map((todo) => (
    <Todo key={todo.id}
     text={todo.text} 
    todos={todos}
    todo={todo}
    setTodos={setTodos}/>
))}
</ul>
</div>
    )
}

export default List
